// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

import "./CollectCoin.sol";

contract PeriodicTimeLockedWallet
{
    address public creator;
    address payable public owner;
    uint256 public lockDate;
    uint256 public createdAt;

    uint256 public unlockPeriod;
    uint public unlockPercentage;

    uint256 private unlockedAmount;

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }


    event WithdrewTokens(address tokenContract, address to, uint256 amount);

    constructor(address _creator, address payable _owner, uint256 _lockDate, uint256 _unlockPeriod, uint _unlockPercentage)
    {
        creator = _creator;
        owner = _owner;
        lockDate = _lockDate;
        createdAt = block.timestamp;

        unlockedAmount = 0;
        unlockPeriod = _unlockPeriod;
        unlockPercentage = _unlockPercentage;
    }

    receive() external payable
    {
        // we do not accept any native coin on this wallet
        revert();
    }

    // callable by owner only, after specified time, only for Tokens implementing ERC20
    function withdrawTokens(address _tokenContract) onlyOwner public 
    {
       //require(block.timestamp >= unlockDate);

       CollectCoin token = CollectCoin(_tokenContract);

       // calculate the max release since lock time

       //now send all the token balance
       uint256 tokenBalance = token.balanceOf(address(this));
       token.transfer(owner, tokenBalance);
       emit WithdrewTokens(_tokenContract, msg.sender, tokenBalance);
    }

    function getUnlockedTokenAmount(address _tokenContract) onlyOwner public view returns (uint256)
    {
        CollectCoin token = CollectCoin(_tokenContract);
        uint256 tokenBalance = token.balanceOf(address(this));

        uint256 timeDiff = block.timestamp - lockDate;

        uint unlockedUnits = timeDiff / unlockPeriod;

        return (unlockedUnits * unlockPercentage * tokenBalance) / 100 - unlockedAmount;
    }
}
